    return (
        <header className="nav-bar">
            <a href="/" className="nav-bar--link">Home</a>
            <a href="/scout" className="nav-bar--link">Scout</a>
            <a href="/randomscout" className="nav-bar--link">Random Scout</a>
        </header>
    );
};

export default NavigationBar;
